import NavigationBar from "../NavigationBar/NavigationBar";
import Avatar from "../Avatar/Avatar";
import Education from "../Education/Education";
import "./App.css";
function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Avatar />

      <div id="education">
        <Education />
      </div>
    </div>
  );
}

export default App;
